Ext.data.JsonP['Titanium_UI_iOS_FeedbackGenerator']({"tagname":"class","name":"Titanium.UI.iOS.FeedbackGenerator","extends":"Titanium.Proxy","mixins":[],"alternateClassNames":[],"aliases":{},"singleton":false,"requires":[],"uses":[],"enum":null,"override":null,"inheritable":null,"inheritdoc":null,"meta":{"platform":["iphone 6.0.0"],"editurl":"https://github.com/appcelerator/titanium_mobile/edit/master/apidoc/Titanium/UI/iOS/FeedbackGenerator.yml","description":["<p>On supported devices, haptics provide a way to physically engage users with tactile feedback that gets attention and\nreinforces actions. Some system-provided interface elements, such as pickers, switches, and sliders, automatically provide\nhaptic feedback as users interact with them. Your app can also ask the system to generate different types of haptic feedback.\niOS manages the strength and behavior of this feedback.</p>\n\n<p>There are three different kind of feedback generators that can be used for different interaction scenarios:</p>\n\n<ol>\n<li><p><strong>Selection Feedback</strong>: Indicates that a task or action, such as depositing a check or unlocking a vehicle, has completed,\n failed, or produced a warning of some kind.. This feedback type can be used when specifying the\n {@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_TYPE_SELECTION} constant in the <code>type</code> property of the feedback generator.</p></li>\n<li><p><strong>Impact Feedback</strong>: Provides a physical metaphor that complements the visual experience. For example, the user might feel\n a thud when a view slides into place or two objects collide. This feedback type can be used when specifying the\n {@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_TYPE_IMPACT} constant in the <code>type</code> property of the feedback generator. Note that if you use\n this generator type, you also have to specify the <code>style</code> property that can be one of the\n {@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_IMPACT_STYLE_LIGHT}, {@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_IMPACT_STYLE_MEDIUM} or\n {@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_IMPACT_STYLE_HEAVY} constant.</p></li>\n<li><p><strong>Notification Feedback</strong>: Indicates that the selection is actively changing. For example, the user feels light taps while\n scrolling a picker wheel. This feedback is intended for communicating movement through a series of discrete values, not\n making or confirming a selection. This feedback type can be used when using the {@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION}\n constant in the <code>type</code> property of the feedback generator.</p></li>\n</ol>\n\n<p>See also:</p>\n\n<ul>\n<li><a href=\"https://developer.apple.com/ios/human-interface-guidelines/interaction/feedback/\">iOS Developer Library: Haptic Feedback</a></li>\n</ul>"]},"private":null,"id":"class-Titanium.UI.iOS.FeedbackGenerator","members":{"cfg":[],"property":[{"name":"apiName","tagname":"property","owner":"Titanium.Proxy","meta":{"readonly":true,"description":["<p>The value of this property is the fully qualified name of the API. For example, {@link Titanium.UI.Button Button}\nreturns <code>Ti.UI.Button</code>.</p>"],"platform":["android 3.2.0","iphone 3.2.0","ipad 3.2.0","windowsphone 4.1.0"]},"id":"property-apiName"},{"name":"bubbleParent","tagname":"property","owner":"Titanium.Proxy","meta":{"description":["<p>Some proxies (most commonly views) have a relationship to other proxies, often\nestablished by the add() method. For example, for a button added to a window, a\nclick event on the button would bubble up to the window. Other common parents are\ntable sections to their rows, table views to their sections, and scrollable views\nto their views. Set this property to false to disable the bubbling to the proxy's parent.</p>"],"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"property-bubbleParent"},{"name":"lifecycleContainer","tagname":"property","owner":"Titanium.Proxy","meta":{"description":["<p>If this property is set to a Window or TabGroup, then the corresponding Activity lifecycle event callbacks\nwill also be called on the proxy. Proxies that require the activity lifecycle will need this property set\nto the appropriate containing Window or TabGroup.</p>"],"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"property-lifecycleContainer"},{"name":"type","tagname":"property","owner":"Titanium.UI.iOS.FeedbackGenerator","meta":{"creationOnly":[null]},"id":"property-type"}],"method":[{"name":"addEventListener","tagname":"method","owner":"Titanium.Proxy","meta":{},"id":"method-addEventListener"},{"name":"applyProperties","tagname":"method","owner":"Titanium.Proxy","meta":{"description":["<p>Properties are supplied as a dictionary. Each key-value pair in the object is applied to the proxy such that\nmyproxy[key] = value.</p>"],"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-applyProperties"},{"name":"fireEvent","tagname":"method","owner":"Titanium.Proxy","meta":{},"id":"method-fireEvent"},{"name":"getApiName","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.2.0","iphone 3.2.0","ipad 3.2.0","windowsphone 4.1.0"]},"id":"method-getApiName"},{"name":"getBubbleParent","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-getBubbleParent"},{"name":"getLifecycleContainer","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"method-getLifecycleContainer"},{"name":"getType","tagname":"method","owner":"Titanium.UI.iOS.FeedbackGenerator","meta":{},"id":"method-getType"},{"name":"impactOccurred","tagname":"method","owner":"Titanium.UI.iOS.FeedbackGenerator","meta":{"description":["<p>Note that this method can only be used if the feeback generator type is set to\n{@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_TYPE_IMPACT}.</p>"]},"id":"method-impactOccurred"},{"name":"notificationOccurred","tagname":"method","owner":"Titanium.UI.iOS.FeedbackGenerator","meta":{"description":["<p>Note that this method can only be used if the feeback generator type is set to\n{@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION}. The single argument provided is one of the</p>"]},"id":"method-notificationOccurred"},{"name":"prepare","tagname":"method","owner":"Titanium.UI.iOS.FeedbackGenerator","meta":{"description":["<p>Apple recommends to use this method before calling one of the <code>selectionChanged</code>,\n<code>impactOccurred</code> or <code>notificationOccurred</code> methods to reduce a possible latency.      </p>"]},"id":"method-prepare"},{"name":"removeEventListener","tagname":"method","owner":"Titanium.Proxy","meta":{"description":["<p>Multiple listeners can be registered for the same event, so the\n<code>callback</code> parameter is used to determine which listener to remove.</p>\n\n<p>When adding a listener, you must save a reference to the callback function\nin order to remove the listener later:</p>\n\n<pre><code>var listener = function() { Ti.API.info(\"Event listener called.\"); }\nwindow.addEventListener('click', listener);\n</code></pre>\n\n<p>To remove the listener, pass in a reference to the callback function:</p>\n\n<pre><code>window.removeEventListener('click', listener);\n</code></pre>"]},"id":"method-removeEventListener"},{"name":"selectionChanged","tagname":"method","owner":"Titanium.UI.iOS.FeedbackGenerator","meta":{"description":["<p>Note that this method can only be used if the feeback generator type is set to\n{@link Titanium.UI.iOS#property-FEEDBACK_GENERATOR_TYPE_SELECTION}.</p>"]},"id":"method-selectionChanged"},{"name":"setBubbleParent","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.0.0","iphone 3.0.0","ipad 3.0.0","windowsphone 4.1.0"]},"id":"method-setBubbleParent"},{"name":"setLifecycleContainer","tagname":"method","owner":"Titanium.Proxy","meta":{"platform":["android 3.6.0","windowsphone 4.1.0"]},"id":"method-setLifecycleContainer"},{"name":"setType","tagname":"method","owner":"Titanium.UI.iOS.FeedbackGenerator","meta":{},"id":"method-setType"}],"event":[],"css_var":[],"css_mixin":[]},"linenr":225819,"files":[{"filename":"titanium.js","href":"titanium.html#Titanium-UI-iOS-FeedbackGenerator"}],"html_meta":{"platform":"<ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>6.0.0</li></ul>","editurl":null,"description":"<p><p>On supported devices, haptics provide a way to physically engage users with tactile feedback that gets attention and\nreinforces actions. Some system-provided interface elements, such as pickers, switches, and sliders, automatically provide\nhaptic feedback as users interact with them. Your app can also ask the system to generate different types of haptic feedback.\niOS manages the strength and behavior of this feedback.</p>\n\n\n\n\n<p>There are three different kind of feedback generators that can be used for different interaction scenarios:</p>\n\n\n\n\n<ol>\n<li><p><strong>Selection Feedback</strong>: Indicates that a task or action, such as depositing a check or unlocking a vehicle, has completed,\n failed, or produced a warning of some kind.. This feedback type can be used when specifying the\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_SELECTION</a> constant in the <code>type</code> property of the feedback generator.</p></li>\n<li><p><strong>Impact Feedback</strong>: Provides a physical metaphor that complements the visual experience. For example, the user might feel\n a thud when a view slides into place or two objects collide. This feedback type can be used when specifying the\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_IMPACT</a> constant in the <code>type</code> property of the feedback generator. Note that if you use\n this generator type, you also have to specify the <code>style</code> property that can be one of the\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_LIGHT\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_LIGHT\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_IMPACT_STYLE_LIGHT</a>, <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_MEDIUM\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_MEDIUM\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_IMPACT_STYLE_MEDIUM</a> or\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_HEAVY\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_HEAVY\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_IMPACT_STYLE_HEAVY</a> constant.</p></li>\n<li><p><strong>Notification Feedback</strong>: Indicates that the selection is actively changing. For example, the user feels light taps while\n scrolling a picker wheel. This feedback is intended for communicating movement through a series of discrete values, not\n making or confirming a selection. This feedback type can be used when using the <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_NOTIFICATION</a>\n constant in the <code>type</code> property of the feedback generator.</p></li>\n</ol>\n\n\n\n\n<p>See also:</p>\n\n\n\n\n<ul>\n<li><a href=\"https://developer.apple.com/ios/human-interface-guidelines/interaction/feedback/\">iOS Developer Library: Haptic Feedback</a></li>\n</ul>\n\n</p>"},"statics":{"cfg":[],"property":[],"method":[],"event":[],"css_var":[],"css_mixin":[]},"component":false,"superclasses":["Titanium.Proxy","Titanium.UI.iOS.FeedbackGenerator"],"subclasses":[],"mixedInto":[],"parentMixins":[],"html":"<div><div class='sidebar'><ul class=\"sidebar-platforms\"><li class='platform-iphone' title='iPhone since Titanium SDK 6.0.0'>iPhone 6.0.0</li></ul></div><div class='hierarchy'><div class='classes'><div class='subclass'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='docClass'>Titanium.Proxy</a></div><div class='subclass'> &gt; <strong>Titanium.UI.iOS.FeedbackGenerator</strong></div></div></div><div class='doc-contents'><p>The feedback generator API is introduced in iOS 10 to handle the haptic feedback when using an iPhone 7 or \nlater devices.</p>\n\n\n\n\n<p> <b>Requires:</b> \niOS 10.0 and later \n</p>\n\n<p><p>On supported devices, haptics provide a way to physically engage users with tactile feedback that gets attention and\nreinforces actions. Some system-provided interface elements, such as pickers, switches, and sliders, automatically provide\nhaptic feedback as users interact with them. Your app can also ask the system to generate different types of haptic feedback.\niOS manages the strength and behavior of this feedback.</p>\n\n\n\n\n<p>There are three different kind of feedback generators that can be used for different interaction scenarios:</p>\n\n\n\n\n<ol>\n<li><p><strong>Selection Feedback</strong>: Indicates that a task or action, such as depositing a check or unlocking a vehicle, has completed,\n failed, or produced a warning of some kind.. This feedback type can be used when specifying the\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_SELECTION</a> constant in the <code>type</code> property of the feedback generator.</p></li>\n<li><p><strong>Impact Feedback</strong>: Provides a physical metaphor that complements the visual experience. For example, the user might feel\n a thud when a view slides into place or two objects collide. This feedback type can be used when specifying the\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_IMPACT</a> constant in the <code>type</code> property of the feedback generator. Note that if you use\n this generator type, you also have to specify the <code>style</code> property that can be one of the\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_LIGHT\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_LIGHT\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_IMPACT_STYLE_LIGHT</a>, <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_MEDIUM\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_MEDIUM\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_IMPACT_STYLE_MEDIUM</a> or\n <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_HEAVY\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_IMPACT_STYLE_HEAVY\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_IMPACT_STYLE_HEAVY</a> constant.</p></li>\n<li><p><strong>Notification Feedback</strong>: Indicates that the selection is actively changing. For example, the user feels light taps while\n scrolling a picker wheel. This feedback is intended for communicating movement through a series of discrete values, not\n making or confirming a selection. This feedback type can be used when using the <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_NOTIFICATION</a>\n constant in the <code>type</code> property of the feedback generator.</p></li>\n</ol>\n\n\n\n\n<p>See also:</p>\n\n\n\n\n<ul>\n<li><a href=\"https://developer.apple.com/ios/human-interface-guidelines/interaction/feedback/\">iOS Developer Library: Haptic Feedback</a></li>\n</ul>\n\n</p><ul class='platforms'><li class='platform-iphone'\n        title='iPhone'>6.0.0</li></ul></div><div class='members'><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-property'>Properties</h3><div class='subsection'><div id='property-apiName' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-apiName' class='name not-expandable'>apiName</a><span> : String</span><strong class='readonly signature' >readonly</strong></div><div class='description'><div class='short'><p>The name of the API that this proxy corresponds to.</p>\n\n</div><div class='long'><p>The name of the API that this proxy corresponds to.</p>\n\n<p><p>The value of this property is the fully qualified name of the API. For example, <a href=\"#!/api/Titanium.UI.Button\" rel=\"Titanium.UI.Button\" class=\"docClass\">Button</a>\nreturns <code>Ti.UI.Button</code>.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.2.0</li><li class='platform-iphone'\n        title='iPhone'>3.2.0</li><li class='platform-ipad'\n        title='iPad'>3.2.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-bubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-bubbleParent' class='name expandable'>bubbleParent</a><span> : Boolean</span></div><div class='description'><div class='short'>Indicates if the proxy will bubble an event to its parent. ...</div><div class='long'><p>Indicates if the proxy will bubble an event to its parent.</p>\n\n<p><p>Some proxies (most commonly views) have a relationship to other proxies, often\nestablished by the add() method. For example, for a button added to a window, a\nclick event on the button would bubble up to the window. Other common parents are\ntable sections to their rows, table views to their sections, and scrollable views\nto their views. Set this property to false to disable the bubbling to the proxy's parent.</p>\n\n</p><p>Default: true</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-lifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-property-lifecycleContainer' class='name not-expandable'>lifecycleContainer</a><span> : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></span></div><div class='description'><div class='short'><p>The Window or TabGroup whose Activity lifecycle should be triggered on the proxy.</p>\n\n</div><div class='long'><p>The Window or TabGroup whose Activity lifecycle should be triggered on the proxy.</p>\n\n<p><p>If this property is set to a Window or TabGroup, then the corresponding Activity lifecycle event callbacks\nwill also be called on the proxy. Proxies that require the activity lifecycle will need this property set\nto the appropriate containing Window or TabGroup.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul></div></div></div><div id='property-type' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.UI.iOS.FeedbackGenerator'>Titanium.UI.iOS.FeedbackGenerator</span></div><a href='#!/api/Titanium.UI.iOS.FeedbackGenerator-property-type' class='name expandable'>type</a><span> : Number</span><strong class='creationOnly signature' >Creation-Only</strong></div><div class='description'><div class='short'>The type of feedback generator you want to create. ...</div><div class='long'><p>The type of feedback generator you want to create.</p>\n\n\n\n\n<p>This API can be assigned the following constants:<ul>\n <li> <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_SELECTION</a>\n <li> <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_IMPACT</a>\n <li> <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_NOTIFICATION</a>\n</li></li></li></ul></p>\n\n</div></div></div></div></div><div class='members-section'><div class='definedBy'>Defined By</div><h3 class='members-title icon-method'>Methods</h3><div class='subsection'><div id='method-addEventListener' class='member first-child inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-addEventListener' class='name expandable'>addEventListener</a>( <span class='pre'>name, callback</span> )</div><div class='description'><div class='short'>Adds the specified callback as an event listener for the named event. ...</div><div class='long'><p>Adds the specified callback as an event listener for the named event.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to invoke when the event is fired.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-applyProperties' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-applyProperties' class='name expandable'>applyProperties</a>( <span class='pre'>props</span> )</div><div class='description'><div class='short'>Applies the properties to the proxy. ...</div><div class='long'><p>Applies the properties to the proxy.</p>\n\n<p><p>Properties are supplied as a dictionary. Each key-value pair in the object is applied to the proxy such that\nmyproxy[key] = value.</p>\n\n</p><ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>props</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of properties to apply.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-fireEvent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-fireEvent' class='name expandable'>fireEvent</a>( <span class='pre'>name, event</span> )</div><div class='description'><div class='short'>Fires a synthesized event to any registered listeners. ...</div><div class='long'><p>Fires a synthesized event to any registered listeners.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>event</span> : <a href=\"#!/api/Dictionary\" rel=\"Dictionary\" class=\"docClass\">Dictionary</a><div class='sub-desc'><p>A dictionary of keys and values to add to the <a href=\"#!/api/Titanium.Event\" rel=\"Titanium.Event\" class=\"docClass\">Titanium.Event</a> object sent to the listeners.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-getApiName' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getApiName' class='name expandable'>getApiName</a>( <span class='pre'></span> ) : String</div><div class='description'><div class='short'>Gets the value of the apiName property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-apiName\" rel=\"Titanium.Proxy-property-apiName\" class=\"docClass\">apiName</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.2.0</li><li class='platform-iphone'\n        title='iPhone'>3.2.0</li><li class='platform-ipad'\n        title='iPad'>3.2.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>String</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getBubbleParent' class='name expandable'>getBubbleParent</a>( <span class='pre'></span> ) : Boolean</div><div class='description'><div class='short'>Gets the value of the bubbleParent property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>Boolean</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getLifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-getLifecycleContainer' class='name expandable'>getLifecycleContainer</a>( <span class='pre'></span> ) : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></div><div class='description'><div class='short'>Gets the value of the lifecycleContainer property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.Proxy-property-lifecycleContainer\" rel=\"Titanium.Proxy-property-lifecycleContainer\" class=\"docClass\">lifecycleContainer</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'><a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a></span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-getType' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.UI.iOS.FeedbackGenerator'>Titanium.UI.iOS.FeedbackGenerator</span></div><a href='#!/api/Titanium.UI.iOS.FeedbackGenerator-method-getType' class='name expandable'>getType</a>( <span class='pre'></span> ) : Number</div><div class='description'><div class='short'>Gets the value of the type property. ...</div><div class='long'><p>Gets the value of the <a href=\"#!/api/Titanium.UI.iOS.FeedbackGenerator-property-type\" rel=\"Titanium.UI.iOS.FeedbackGenerator-property-type\" class=\"docClass\">type</a> property.</p>\n\n<h3 class='pa'>Returns</h3><ul><li><span class='pre'>Number</span><div class='sub-desc'>\n</div></li></ul></div></div></div><div id='method-impactOccurred' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.UI.iOS.FeedbackGenerator'>Titanium.UI.iOS.FeedbackGenerator</span></div><a href='#!/api/Titanium.UI.iOS.FeedbackGenerator-method-impactOccurred' class='name expandable'>impactOccurred</a>( <span class='pre'></span> )</div><div class='description'><div class='short'>Used to trigger a haptic feedback after an impact occurred. ...</div><div class='long'><p>Used to trigger a haptic feedback after an impact occurred.</p>\n\n<p><p>Note that this method can only be used if the feeback generator type is set to\n<a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_IMPACT\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_IMPACT</a>.</p>\n\n</p><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-notificationOccurred' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.UI.iOS.FeedbackGenerator'>Titanium.UI.iOS.FeedbackGenerator</span></div><a href='#!/api/Titanium.UI.iOS.FeedbackGenerator-method-notificationOccurred' class='name expandable'>notificationOccurred</a>( <span class='pre'>notificationType</span> )</div><div class='description'><div class='short'>Used to trigger a haptic feedback after a notification has been received. ...</div><div class='long'><p>Used to trigger a haptic feedback after a notification has been received.</p>\n\n<p><p>Note that this method can only be used if the feeback generator type is set to\n<a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_NOTIFICATION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_NOTIFICATION</a>. The single argument provided is one of the</p>\n\n</p><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>notificationType</span> : Number<div class='sub-desc'><p>The type of the notification to manage the peculiarity of the haptic feedback. If this\nparameter is not specified, an error will be thrown.</p>\n\n\n<p>This API can be assigned the following constants:<ul>\n <li> <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_NOTIFICATION_TYPE_SUCCESS\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_NOTIFICATION_TYPE_SUCCESS\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_NOTIFICATION_TYPE_SUCCESS</a>\n <li> <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_NOTIFICATION_TYPE_WARNING\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_NOTIFICATION_TYPE_WARNING\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_NOTIFICATION_TYPE_WARNING</a>\n <li> <a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_NOTIFICATION_TYPE_ERROR\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_NOTIFICATION_TYPE_ERROR\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_NOTIFICATION_TYPE_ERROR</a>\n</li></li></li></ul></p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-prepare' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.UI.iOS.FeedbackGenerator'>Titanium.UI.iOS.FeedbackGenerator</span></div><a href='#!/api/Titanium.UI.iOS.FeedbackGenerator-method-prepare' class='name expandable'>prepare</a>( <span class='pre'></span> )</div><div class='description'><div class='short'>Used to prepare the haptic sensor for the upcoming interaction with it. ...</div><div class='long'><p>Used to prepare the haptic sensor for the upcoming interaction with it.</p>\n\n<p><p>Apple recommends to use this method before calling one of the <code>selectionChanged</code>,\n<code>impactOccurred</code> or <code>notificationOccurred</code> methods to reduce a possible latency.      </p>\n\n</p><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-removeEventListener' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-removeEventListener' class='name expandable'>removeEventListener</a>( <span class='pre'>name, callback</span> )</div><div class='description'><div class='short'>Removes the specified callback as an event listener for the named event. ...</div><div class='long'><p>Removes the specified callback as an event listener for the named event.</p>\n\n<p><p>Multiple listeners can be registered for the same event, so the\n<code>callback</code> parameter is used to determine which listener to remove.</p>\n\n\n\n\n<p>When adding a listener, you must save a reference to the callback function\nin order to remove the listener later:</p>\n\n\n\n\n<pre><code>var listener = function() { Ti.API.info(\"Event listener called.\"); }\nwindow.addEventListener('click', listener);\n</code></pre>\n\n\n\n\n<p>To remove the listener, pass in a reference to the callback function:</p>\n\n\n\n\n<pre><code>window.removeEventListener('click', listener);\n</code></pre>\n\n</p><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>name</span> : String<div class='sub-desc'><p>Name of the event.</p>\n\n</div></li><li><span class='pre'>callback</span> : Callback&lt;Object&gt;<div class='sub-desc'><p>Callback function to remove. Must be the same function passed to <code>addEventListener</code>.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-selectionChanged' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.UI.iOS.FeedbackGenerator'>Titanium.UI.iOS.FeedbackGenerator</span></div><a href='#!/api/Titanium.UI.iOS.FeedbackGenerator-method-selectionChanged' class='name expandable'>selectionChanged</a>( <span class='pre'></span> )</div><div class='description'><div class='short'>Used to trigger a haptic feedback after a selection has been made. ...</div><div class='long'><p>Used to trigger a haptic feedback after a selection has been made.</p>\n\n<p><p>Note that this method can only be used if the feeback generator type is set to\n<a href=\"#!/api/Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" rel=\"Titanium.UI.iOS-property-FEEDBACK_GENERATOR_TYPE_SELECTION\" class=\"docClass\">Titanium.UI.iOS.FEEDBACK_GENERATOR_TYPE_SELECTION</a>.</p>\n\n</p><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-setBubbleParent' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-setBubbleParent' class='name expandable'>setBubbleParent</a>( <span class='pre'>bubbleParent</span> )</div><div class='description'><div class='short'>Sets the value of the bubbleParent property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Proxy-property-bubbleParent\" rel=\"Titanium.Proxy-property-bubbleParent\" class=\"docClass\">bubbleParent</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.0.0</li><li class='platform-iphone'\n        title='iPhone'>3.0.0</li><li class='platform-ipad'\n        title='iPad'>3.0.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>bubbleParent</span> : Boolean<div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-setLifecycleContainer' class='member  inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><a href='#!/api/Titanium.Proxy' rel='Titanium.Proxy' class='defined-in docClass'>Titanium.Proxy</a></div><a href='#!/api/Titanium.Proxy-method-setLifecycleContainer' class='name expandable'>setLifecycleContainer</a>( <span class='pre'>lifecycleContainer</span> )</div><div class='description'><div class='short'>Sets the value of the lifecycleContainer property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.Proxy-property-lifecycleContainer\" rel=\"Titanium.Proxy-property-lifecycleContainer\" class=\"docClass\">lifecycleContainer</a> property.</p>\n\n<ul class='platforms'><li class='platform-android'\n        title='Android'>3.6.0</li><li class='platform-windowsphone'\n        title='Window Phone'>4.1.0</li></ul><h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>lifecycleContainer</span> : <a href=\"#!/api/Titanium.UI.Window\" rel=\"Titanium.UI.Window\" class=\"docClass\">Titanium.UI.Window</a>/<a href=\"#!/api/Titanium.UI.TabGroup\" rel=\"Titanium.UI.TabGroup\" class=\"docClass\">Titanium.UI.TabGroup</a><div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div><div id='method-setType' class='member  not-inherited'><a href='#' class='side expandable'><span>&nbsp;</span></a><div class='title'><div class='meta'><span class='defined-in' rel='Titanium.UI.iOS.FeedbackGenerator'>Titanium.UI.iOS.FeedbackGenerator</span></div><a href='#!/api/Titanium.UI.iOS.FeedbackGenerator-method-setType' class='name expandable'>setType</a>( <span class='pre'>type</span> )</div><div class='description'><div class='short'>Sets the value of the type property. ...</div><div class='long'><p>Sets the value of the <a href=\"#!/api/Titanium.UI.iOS.FeedbackGenerator-property-type\" rel=\"Titanium.UI.iOS.FeedbackGenerator-property-type\" class=\"docClass\">type</a> property.</p>\n\n<h3 class=\"pa\">Parameters</h3><ul><li><span class='pre'>type</span> : Number<div class='sub-desc'><p>New value for the property.</p>\n\n</div></li></ul><h3 class='pa'>Returns</h3><ul><li><span class='pre'>void</span></li></ul></div></div></div></div></div></div></div>"});